import React from "react"

const styles = {
    body__buttonFilter: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },

    span__chechbox: {
        marginTop: '0',
        marginRight: '1rem',
        textDecoration: 'line-through',
    },

    body__li: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '1rem 1rem',
        border: '0px solid',
        borderRadius: '15px',
        background: '#EBECF0',
        marginBottom: '1.5rem',
        transition: '0.4s',
    },

    button: {
        outline: 'none',
    },
};

export default function TodoFilter(props) {
    return (
        <div style={styles.body__buttonFilter}>
            <button></button>
            <button></button>
            <button></button>
        </div>
    )
}
